  if(isAuthenticated){

    return (
      <>
      <BrowserRouter>

  <Home/>
      </BrowserRouter>
    </>
    );
  }else{
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<Login />} />
    </Routes>
  </BrowserRouter>
}
}
